import React from 'react';

const Navigation = ({ onRouteChange, route }) => {
    let status = 'Sign In';
    if (route === 'home') {
        status = 'Sign Out';
    }
    return (
        <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
            <p onClick={() => onRouteChange('signin')} className='f3 link dim black underline pa3 pointer'>{status}</p>
        </nav>
    );
}

export default Navigation;
